CREATE TABLE "song_charts" (
	"id" serial NOT NULL,
	"song_name" varchar(255) NOT NULL,
	"spotify_song_id" varchar(50) NOT NULL,
	"artist" varchar(255) NOT NULL,
	"rank" integer NOT NULL,
	"spotify_playlist_id" varchar(50) NOT NULL,
	"date" DATE NOT NULL,
	"price" INT,
	CONSTRAINT "song_charts_pk" PRIMARY KEY ("id")
) WITH (
  OIDS=FALSE
);


CREATE TABLE "user" (
	"id" serial NOT NULL,
	"username" varchar(80) NOT NULL UNIQUE,
	"password" varchar(1000) NOT NULL,
	"created_at" DATE NOT NULL,
	"total_cash" integer NOT NULL,
	"buying_power" integer NOT NULL,
	CONSTRAINT "user_pk" PRIMARY KEY ("id")
) WITH (
  OIDS=FALSE
);


CREATE TABLE "song_holdings" (
	"id" serial NOT NULL,
	"user_id" integer NOT NULL,
	"quantity" integer NOT NULL,
	"date_purchased" DATE NOT NULL,
	"song_id" integer NOT NULL,
	CONSTRAINT "song_holdings_pk" PRIMARY KEY ("id")
) WITH (
  OIDS=FALSE
);


CREATE TABLE "historical_portfolio" (
	"id" serial NOT NULL,
	"user_id" integer NOT NULL,
	"value" integer NOT NULL,
	"date" DATE NOT NULL,
	CONSTRAINT "historical_portfolio_pk" PRIMARY KEY ("id")
) WITH (
  OIDS=FALSE
);


CREATE TABLE "historical_song_holdings" (
	"id" serial NOT NULL,
	"holding_id" INT REFERENCES "song_current",
	"date" DATE NOT NULL,
	"value" integer NOT NULL,
	"rank" int,
	CONSTRAINT "historical_song_holdings_pk" PRIMARY KEY ("id")
) WITH (
  OIDS=FALSE
);


CREATE TABLE "song_current" (
	"id" serial NOT NULL,
	"spotify_song_id" varchar(50) NOT NULL,
	"spotify_playlist_id" varchar(50) NOT NULL,
	"artist" varchar(255) NOT NULL,
	"song_name" varchar(255) NOT NULL,
	"current_rank" integer NOT NULL,
	"price" int,
	CONSTRAINT "song_current_pk" PRIMARY KEY ("id")
) WITH (
  OIDS=FALSE
);

ALTER TABLE "song_holdings" ADD CONSTRAINT "song_holdings_fk0" FOREIGN KEY ("user_id") REFERENCES "user"("id");
ALTER TABLE "song_holdings" ADD CONSTRAINT "song_holdings_fk1" FOREIGN KEY ("song_id") REFERENCES "song_current"("id");
ALTER TABLE "historical_portfolio" ADD CONSTRAINT "historical_portfolio_fk0" FOREIGN KEY ("user_id") REFERENCES "user"("id");









